import React, { Component } from "react";
import { Row, Col } from "reactstrap";
import "./contents.css";

class Contents extends Component {
  render() {
    return (
      <div style={{ margin: 40 }}>
        <h1 style={{ color: "#ff6e6e", fontWeight: "bold" }}>
          {" "}
          {"// Contents"}
        </h1>
        <div style={{ textAlign: "center" }}>
          <Row>
            <Col>
              <h5> {"// Engineering"}</h5>
              <p> Thinkspaces &emsp; Cofounder</p>
            </Col>
            <Col>
              <h5> {"// Design"}</h5>
            </Col>
            <Col>
              <h5> {"// Illustration & Painting"}</h5>
            </Col>
            <Col>
              <h5> {"// Photography"}</h5>
            </Col>
          </Row>
        </div>
      </div>
    );
  }
}

export default Contents;
